import Card from "../Card/Card"
import { useSelector } from "react-redux";


export const Favorites = () => {
    const myFavorites = useSelector(state => state.myFavorites);
return (
    <div>
        {
        myFavorites?.map((fav) => {
            <Card
            key={fav.id}
            id={fav.id}
            name={fav.name}
            species={fav.species}
            gender={fav.gender}
            image={fav.image}
            />
        })
        }
    </div>
);
}

export default Favorites
